message:
AO PODER MODERADOR, AS FORÇAS ARMADAS

A pedido do PODER CONSTITUINTE ORIGINÁRIO, o povo, aos milhões nas ruas, espontaneamente;

RESTABELEÇAM A LEI E A ORDEM conforme Art. 142 da Constituição Federal pela OMISSÃO DO SENADO às arbitrariedades do STF/TSE;

NÃO RECONHEÇAM A MANOBRA JURÍDICA DE COMPARSAS DO STF para descondenar, eleger e os senhores baterem continência para o Chefe da maior Organização Criminosa da história da humanidade, condenado em três instâncias; 

NÃO RECONHEÇAM A ELEIÇÃO PARA PRESIDENTE DA REPÚBLICA EM 2022, altamente suspeita, por um sistema sujeito a fraude, não transparente, de Contagem Eletrônica Secreta dos Votos (escrutínio secreto) que é ilegal, inconstitucional e antidemocrático.

“Quem vota e como vota não conta nada; quem conta os votos é que realmente importa." Joseph Stálin

TO THE MODERATING POWERS, THE BRAZILIAN ARMED FORCES

At the request of the ORIGINATING CONSTITUENT POWER, the people, by the millions in the streets, spontaneously; 

REESTABLISH LAW AND ORDER according to Section. 142 of the Federal Constitution for the OMISSION OF THE SENATE to the arbitrariness of the Supreme Federal Tribunal/ Supreme Electoral Tribunal; 

DO NOT RECOGNIZE THE LEGAL MANEUVER OF COMPARSAS OF THE  SUPREME FEDERAL TRIBUNAL to pardon, elect and salute the Chief of the largest Criminal Organization in the history of mankind, convicted in three instances; 

DO NOT RECOGNIZE THE ELECTION FOR PRESIDENT OF THE BRAZILIAN REPUBLIC IN 2022, highly suspected, by a system subject to fraud, non-transparent, Secret Electronic Counting of the Votes (secret ballot) that is, unconstitutional and undemocratic. 

“It's not the people who vote that count, it's the people who count the votes." Joseph Stalin

🚨 *ATENÇÃO* 🚨

*11 DIAS EM FRENTE OS QUARTÉIS E JÁ CONSEGUIMOS O SEGUINTE:* 

1 Criar uma ruptura na hierarquia da PRF. PF, polícia Militar e guarda Municipal. Exército, Marinha e Aeronáutica. Todas a base das forças estão falando disso. Estão com o Povo e não vão aceitar ordem de Criminosos sentados no poder;

2 - Expor toda a fraude das urnas;

3 - Toda a Mídia internacional cobrindo a fraude no Brasil;

4 - Senadores e Deputados já reconhecem na câmara que não vivíamos em um estado de Direto e que a população está consciente disso;

5 - Partidos como PL já declaram não reconhecer eleição presidencial;

6 - Republicanos vencendo nos EUA. Vão  apoiar nossa solicitação;

7 - Relatório do Exército apontam risco de violação e manipulação das urnas. Falhas na segurança e solicitam abertura de comissão de investigação com Urgencia. Obs: Enquanto, estiver aberta a Comissão de investigação o processo fica suspenso; 

8 – Bolsonaro Nomeia André Tavares como novo Ministro do STE;

9 – Carla Zambelli  vai apresentar  relatório sobre censura à Corte de Direitos Humano terça feira dia 15/11 nos EUA;

10 - STE não apresentou data para diplomação;

11 – Concentração nos quarteis vão aumentar na sexta, sábado e domingo;

12 – Mega Manifestação/Concentração dia  15 de Novembro (Proclamação da República 2022 (Brasil);

Parece pouco para 11 dias? 

*VAMOS MANTER NOSSA POSIÇÃO EM FRENTE DOS QUARTÉIS* 

SOS FORÇAS ARMADAS
LIMPEZA GERAL 🇧🇷 

Em 1964 durou 12 dias para o exército agir contra os comunistas.

*COMPARTILHEM*
